import React from 'react';
import Highlight from '../../components/Highlight';
import UI from '../../assets/svg/ui.svg';
import styles from './Highlights.module.scss';

const { container, icon } = styles;

const Highlights = () => {
  return (
    <div className={container}>
      <UI className={icon} width={100} height={100} />
      <Highlight title="Web development" />
      <Highlight title="Optimising UI and UX" />
      <Highlight title="Analytics and reporting" />
      <Highlight title="Product/project management" />
      <Highlight title="Entrepreneur and innovation" />
      <Highlight title="Team player" />
    </div>
  );
};

export default Highlights;
